INSERT INTO `noticia` (`id`, `titulo`, `id_autor`, `contenido`, `fecha`, `likes`, `destacado`, `imagen1`, `liga`) VALUES
(1, 'Harry Kane: Brillando en la Bundesliga', 2, 'Harry Kane, el delantero estrella del Bayern Munich, está disfrutando de un momento impresionante en su carrera. A pesar de la ‘maldición’ que parece perseguirlo, donde aún no ha ganado un título colectivo, su rendimiento individual ha sido excepcional.Recientemente, Kane anotó su gol número 21 en solo su 15º partido de la Bundesliga, ayudando al Bayern Munich a reclamar una victoria 2-1 sobre Wolfsburgo. Este gol no fue un gol cualquiera, sino un impresionante disparo desde unos 25 metros que se coló en la esquina superior.Además de su éxito en la Bundesliga, Kane también está siendo considerado en las selecciones del Fantasy de la Champions League, donde los fanáticos están debatiendo entre él y Robert Lewandowski.A pesar de los desafíos, Harry Kane sigue demostrando por qué es uno de los mejores delanteros del mundo. Su habilidad para encontrar el fondo de la red es insuperable, y su contribución al Bayern Munich ha sido invaluable. Aunque todavía no ha levantado un trofeo colectivo, su forma actual sugiere que ese día podría estar más cerca de lo que pensamos.', '2024-03-09', 20, 1, , 'Bundesliga');


INSERT INTO `noticia` (`id`, `titulo`, `id_autor`, `contenido`, `fecha`, `likes`, `destacado`, `imagen1`, `liga`) VALUES
(2, 'El Nuevo Santiago Bernabéu: Un Estadio del Futuro', 3, 'El estadio Santiago Bernabéu, hogar del Real Madrid, está experimentando una transformación radical que promete convertirlo en uno de los estadios más avanzados del mundo.Las obras de remodelación, que comenzaron a finales de mayo, tienen un coste estimado de 575 millones de euros y aumentarán la capacidad del estadio en 3.000 espectadores. Además de incrementar el aforo, el nuevo Bernabéu contará con tecnología de punta en la ‘piel’ del exterior, una cubierta retráctil y un videomarcador de 360 grados.Uno de los aspectos más destacados del nuevo Bernabéu es su sistema wifi de alta velocidad, diseñado para ofrecer una experiencia inigualable a los 80.000 espectadores. Este sistema permitirá a los aficionados disfrutar de una conectividad sin precedentes durante los partidos.A pesar de los avances significativos, las obras de remodelación aún no han terminado y se prevén tres años más de trabajos en los alrededores hasta 2027. Sin embargo, cada rincón del nuevo Bernabéu está en ebullición gracias al esfuerzo de todos los equipos involucrados en el proyecto.La transformación del Bernabéu ha generado un gran impacto en la zona de Chamartín, con un aumento del 46% en el precio del alquiler desde que se anunció la reforma del estadio. Esta reforma ha convertido a la zona en el “distrito Real Madrid”, un lugar que promete ser un punto de referencia para los aficionados al fútbol de todo el mundo.En resumen, el nuevo Santiago Bernabéu promete ser mucho más que un estadio. Con su diseño innovador y su tecnología de vanguardia, se está convirtiendo en un símbolo del futuro del fútbol.', '2024-03-12', 17, 1, , 'LaLiga');


